"use strict";
var terminal = require('app/terminal/model');

function Commander(clickHandler){

  terminal.registerCommand({
    matcher: "github",
    fn: function(){
      terminal.type("link http://github.com/petekinnecom"); 
    },
  });

  terminal.registerCommand({
    matcher: "linkedin",
    fn: function(){
      terminal.type("link http://www.linkedin.com/in/petekinnecom"); 
    },
  });
}

module.exports = Commander;
